module.exports = "<div class=\"container\">\r\n    <div id=\"myCarousel\" class=\"carousel slide\" data-ride=\"carousel\">\r\n    \r\n      <!-- Wrapper for slides -->\r\n      <div class=\"carousel-inner\" style=\"max-height: 550px;\">\r\n      \r\n        <div class=\"item active\">\r\n          <img src=\"http://memberclouds.com/members/wp-content/uploads/2016/12/online-course-tracker-slide-01.jpg\">\r\n           <div class=\"carousel-caption\">\r\n            <h3>Course #1</h3>\r\n            <p>If we talk about RDBMS, then aggregate functions are those which process the records based on certain criteria and compute the result such as count (*) function to count the number of rows in a table. <a href=\"#\" target=\"_blank\" class=\"label label-danger\">Course #1</a></p>\r\n          </div>\r\n        </div><!-- End Item -->\r\n \r\n         <div class=\"item\">\r\n          <img src=\"http://memberclouds.com/members/wp-content/uploads/2016/12/online-course-tracker-slide-02.jpg\">\r\n           <div class=\"carousel-caption\">\r\n            <h3>Course #2</h3>\r\n            <p>In the introduction to data science article, we laid the foundation for data science projects by explaining how to set up a data science team and the objectives that need to be met. We noted the data scientist is responsible for analyzing the data to provide insights to decision makers. <a href=\"#\" target=\"_blank\" class=\"label label-danger\">Course #2</a></p>\r\n          </div>\r\n        </div><!-- End Item -->\r\n        \r\n        <div class=\"item\">\r\n          <img src=\"http://memberclouds.com/members/wp-content/uploads/2016/12/online-course-tracker-slide-03.jpg\">\r\n           <div class=\"carousel-caption\">\r\n            <h3>Course #3</h3>\r\n            <p>YouTube was originally designed as a platform for making it easier to share videos, and has now become the go to service for marketing anything, including individuals and products. In todays world, it has become impertinent to have the knowledge of YouTube from how to create an account to how to conduct marketing on YouTube. <a href=\"#\" target=\"_blank\" class=\"label label-danger\">Course #3</a></p>\r\n          </div>\r\n        </div><!-- End Item -->\r\n        \r\n        <div class=\"item\">\r\n          <img src=\"http://memberclouds.com/members/wp-content/uploads/2016/12/online-course-tracker-slide-04.jpg\">\r\n           <div class=\"carousel-caption\">\r\n            <h3>Course #4</h3>\r\n            <p>Linux has revolutionized the way computers work, from chips to phones to desktops, there isn't anything that Linux has not powered. It can be found in your phones, cars, computers and even refrigerators. Remember Android? Well, Android is based on the Linux OS, and designed using Linux. So, what is Linux? <a href=\"#\" target=\"_blank\" class=\"label label-danger\">Course #4</a></p>\r\n          </div>\r\n        </div><!-- End Item -->\r\n                \r\n        <div class=\"item\">\r\n          <img src=\"http://memberclouds.com/members/wp-content/uploads/2016/12/online-course-tracker-slide-05.jpg\">\r\n           <div class=\"carousel-caption\">\r\n            <h3>Course #5</h3>\r\n            <p>In a data science project, there are several key roles and responsibilities which are critical to the success of a project. Depending on the size of the organization, these roles may be filled by one person or one individual may take up several roles. The first role is the project sponsor. The project sponsor is responsible for bringing forward the benefits to the business and evangelizing the value of a data science project. <a href=\"#\" target=\"_blank\" class=\"label label-danger\">Course #5</a></p>\r\n          </div>\r\n        </div><!-- End Item -->\r\n\r\n      </div><!-- End Carousel Inner -->\r\n        <ul class=\"nav nav-pills nav-justified\">\r\n          <li data-target=\"#myCarousel\" data-slide-to=\"0\" class=\"active\"><a href=\"#\">For the Techie<small>Learn about the Aggregation Method in MongoDB.</small></a></li>\r\n          <li data-target=\"#myCarousel\" data-slide-to=\"1\"><a href=\"#\">For the Job Seeker<small>Learn how to load and explore data in R.</small></a></li>\r\n          <li data-target=\"#myCarousel\" data-slide-to=\"2\"><a href=\"#\">For the Creative<small>Youtube Beginners Guide To A Successful Channel</small></a></li>\r\n          <li data-target=\"#myCarousel\" data-slide-to=\"3\"><a href=\"#\">For the Overworked<small>Learn Linux from Scratch</small></a></li>\r\n          <li data-target=\"#myCarousel\" data-slide-to=\"4\"><a href=\"#\">For the Trendsetter<small>Learn what are Data Science Projects and How to Use Them.</small></a></li>\r\n        </ul>\r\n    </div><!-- End Carousel -->\r\n\r\n</div>"

